import Album from './Album'

//this component is the full list of albums
const AlbumList = ({ albums, getAlbums, albumListInstance, resetAlbumListInstance, personid, sort, apiBasePath }) => {
    return (
        <>
            {
                albums.map(
                    (album, index) => (
                        <Album
                            key={album.index}
                            album={album}
                            ratings={ratings}
                            handleChange={handleChange}
                            handleReset={handleReset}
                            getAlbums={getAlbums}
                            albumListInstance={albumListInstance}
                            resetAlbumListInstance={resetAlbumListInstance}
                            personid={personid}
                            sort={sort}
                            apiBasePath={apiBasePath}
                        />
                    )
                )
            }
        </>
    )
}

export default AlbumList
